import "./App.scss";
import React, { useEffect } from "react";
import Row from "./Row/Row";
import RowFreespace from "./Row/RowFreespace";
import VanillaTilt from "vanilla-tilt";
import Button from "../Components/Button/Button";

const App = () => {
  useEffect(() => {
    VanillaTilt.init(document.querySelectorAll(".js-tilt"), {
      max: 20,
      speed: 400,
      glare: true,
      gyroscope: true,
      gyroscopeMinAngleX: -45,
      gyroscopeMaxAngleX: 45,
      gyroscopeMinAngleY: -45,
      gyroscopeMaxAngleY: 45,
    });
  }, []);

  return (
    <>
      <h1 className="game_title">BREAK BINGO</h1>
      <div className="container">
        <div className="bingoBoard">
          <Row />
          <Row />
          <RowFreespace />
          <Row />
          <Row />
        </div>
      </div>
      <div className="controls">
        <Button />
      </div>
      <div style="width:100%;height:0;padding-bottom:75%;position:relative;">
        <iframe
          src="https://giphy.com/embed/kyLYXonQYYfwYDIeZl"
          width="100%"
          height="100%"
          style="position:absolute"
          frameBorder="0"
          class="giphy-embed"
          allowFullScreen
        >
          <p>
            <a href="https://giphy.com/gifs/sesamestreet-sesame-street-50th-anniversary-kyLYXonQYYfwYDIeZl">
              via GIPHY
            </a>
          </p>
        </iframe>
      </div>
    </>
  );
};

export default App;
